import React, { Component } from "react";
import Slider from "react-slick";

export default class Home extends Component {
  render() {
    const settings = {
      dots: true,
      fade: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1,
    };
    return (
      <div>
        <h2>Fade</h2>
        <Slider {...settings}>
          <div>
            <img src="../img/piano.jpg" alt="" />
          </div>
          <div>
            <img src="../img/flute.jpg" alt="" />
          </div>
          <div>
            <img src="../img/violin.jpg" alt="" />
          </div>
        </Slider>
      </div>
    );
  }
}
